        axios.get(`http://localhost:3001/api`)
        .then((props)=> {
            console.log(props, "hola");
            const item = props.data;
            this.setState({item})
            console.log(item);
        })
        .catch(console.log())
    }


    render(){
        return(
            <h1>Hola</h1>
        )
    }
}
